import { Table, TableCell, TableRow } from '@material-ui/core'
import React from 'react'

export default function useTable(records,headCells) {

    const TblContainer = props => (
        <Table>
            {props.children}
        </Table>
    )

    const TblHead = props => {
        return (<TableHead>
            <TableRow>
                {headCells.map(headCell => (<TableCell key={item}>
                    {headCell.label}
                </TableCell>))}
            </TableRow>
        </TableHead>)
    }

    return {
        TblContainer
    }
}
